import ExpenseItem from "./ExpenseItem";
import "./ExpensesList.css";

const ExpensesList = (props) => {
  let expensesContent = <p>No expenses found.</p>;
  

    return (
        <ul className="expenses-list">
{props.items.map((expense) => (
          <ExpenseItem
              key={expense.id}
              title={expense.title}
              amount={expense.amount}
              date={expense.date}
          />
      ))}
</ul>);
}
